import React from 'react'
import { useNavigate } from 'react-router-dom'
import { useAuth } from './auth'

function Home() {
  const navigate = useNavigate()
  const auth = useAuth()
  const handleClick = ()=> {
    if(!auth.user)
    navigate('order-info' , {replce :  true})
  }
  return (
    <>
        <div>Home</div>
        <button onClick={() => handleClick }>Order Now!</button>
    </>
  )
}

export default Home
